import React from 'react';
import SplashEmail from '../components/SplashEmail'

class SplashPage extends React.Component {
	render() {
		return(
			<div className="splashContainer noScroll">
				<div className="splashGradient">
					<div className="splashGrid">
						<div className="splashContent">
						<div className="grid">
							<div className="gridCenterItem"><img src="..src/img/logo.png" alt="Chris Bellingham Logo" /></div>
						</div>
							<h1 className="white marginBottom">Being a patriot means building a collation. Join us!</h1>
							<SplashEmail />
						</div>
					</div>
				</div>
			</div>
		);
	}
}
export default SplashPage;
